const canvas = document.getElementById("canvas1");
const ctx = canvas.getContext("2d");

const image1 = new Image();
image1.src =
  "data:image/png;base64,";
const slider = document.getElementById("resolution");
slider.addEventListener("input", handleSlider);

class Cell {
  constructor(x, y, symbol, color) {
    this.x = x;
    this.y = y;
    this.symbol = symbol;
    this.color = color;
  }
  draw(ctx) {
    ctx.fillStyle = 'white';
    ctx.fillText(this.symbol, this.x + 1, this.y + 1);
    ctx.fillStyle = this.color;
    ctx.fillText(this.symbol, this.x, this.y);
  }
}

class AsciiEffect {
  #imageCellArray = [];
  #symbolsArray = [];
  #pixels = [];
  #ctx;
  #width;
  #height;

  constructor(ctx, width, height) {
    this.#ctx = ctx;
    this.#width = width;
    this.#height = height;
    this.#ctx.drawImage(image1, 0, 0, this.#width, this.#height);
    this.#pixels = this.#ctx.getImageData(0, 0, this.#width, this.#height);
    console.log(this.#pixels);
  }
  #getSymbol(averageColor) {
    const symbols = "@#$%&?*+;:,. ";
    const symbolsArray = symbols.split("");
    const range = 255 / symbolsArray.length;
    const index = Math.floor(averageColor / range);
    return symbolsArray[index];
  }
  #scanImage(cellSize) {
    this.#imageCellArray = [];
    for (let y = 0; y < this.#height; y += cellSize) {
      for (let x = 0; x < this.#width; x += cellSize) {
        const posX = x * 4;
        const posY = y * 4;
        const pos = posY * this.#pixels.width + posX;

        if (this.#pixels.data[pos + 3] > 128) {
          const red = this.#pixels.data[pos];
          const green = this.#pixels.data[pos + 1];
          const blue = this.#pixels.data[pos + 2];
          const total = red + green + blue;
          const averageColor = total / 3;
          const color = `rgb(${red}, ${green}, ${blue})`;
          const symbol = this.#getSymbol(averageColor);
          this.#imageCellArray.push(new Cell(x, y, symbol, color));
        }
      }
    }
  }
  #drawAscii() {
    this.#ctx.clearRect(0, 0, this.#width, this.#height);
    this.#imageCellArray.forEach((cell) => cell.draw(this.#ctx));
  }
  draw(cellSize) {
    this.#scanImage(cellSize);
    this.#drawAscii();
  }
}
let effect;
function handleSlider(e) {
  const value = e.target.value;
  ctx.font = parseInt(value) * 1.2 + 'px Verdana';
  effect.draw(parseInt(value));
}

image1.onload = function init() {
  canvas.width = image1.width;
  canvas.height = image1.height;
  effect = new AsciiEffect(ctx, image1.width, image1.height);
  effect.draw(2);
};
